import React from 'react'
import Paper from "@material-ui/core/Paper"
import { useHistory } from "react-router-dom";


export default function Success() {
    const back=()=>{
        history.goBack();
}
    return (
        <>
                    <Paper style={{ height:"100vh",width:"100%",backgroundColor:"white",position:"absolute",top:"0",zIndex:"999999",display:"grid",placeItems:"center"}}>
                        <h1 style={{fontSize:"3rem"}}>YOUR QUERIES HAS BEEN RECORDED</h1>
                        <button onClick={back} style={{width:"30%",height:"40px",border:"none",backgroundColor:"#CDBA6D",color:"white",fontSize:"1.5rem",position:'relative',top:"60px",right:"39%"}}><strong>goBack</strong></button>

                    </Paper>            
        </>
    )
}
